const Container = styled.main`
  margin: 0;
  padding: 0;
  width: 50%;
  height: 100vh;
  display: flex;
  background-color: #fefefe;  
`

const Layout = props => (
  <>
    <Container>
      { props.children }
    </Container>
    <style jsx global>{`
      #__next{
        height: 100%;
        width: 100%;
        background-color: #292929;
      }

      *{
        margin: 0;
        padding: 0;
        box-sizing: border-box;
      }
    `}</style>
  </>
)

export default Layout
